import React from 'react'
import { Header } from './components/header/Header';
import { SectionImg } from './components/sectionimg/SectionImg';
import data from './data/data'



function App() {
  return (
    <React.Fragment>
      <Header/>
      <SectionImg img={comment.img} title={comment.title} content={data.content} imgPosition={data.imgPosition} />
    </React.Fragment>
  );
}

export default App;
